    false,nt"url": null,nt"notes": "This data compilation includes the results
    of grain size analyses of core sediment collected by IODP during Expedition 323
    in the Bering Sea.  One dataset is included for each of the five sites investigated:
    Sites U1339, U1340, U1341, U1343, and U1344.  The cruise occurred in Summer 2009,
    the analyses were carried out between 2010 and 2012.  This compilation is the only
    sedimentologic resource curently available for the Bering Sea to cover a long period
    of Earth's recent climate history (about 5Ma to present) from different locations
    within the basin (Bering Slope and Bowers Ridge).",nt"license_title": null,nt"extras":
